import React, {useState, useEffect, useContext} from "react";
import axios from "axios";
import "./totalbudget.style.css";
import {AssetContext} from "../../../../context";

const TotalBudget = (props) => {
  const {asset, setAsset} = useContext(AssetContext);

  useEffect(() => {
    axios
      .get(`http://localhost:8080/assets/holdingCount/${JSON.parse(sessionStorage.getItem("logined_user")).userId}`)
      .then((response) => {
        setAsset(response.data.holdingCount);
        console.log(response.data.holdingCount[0].totalAsset);
      })
      .catch((error) => {
        throw error;
      });
  }, []);

  useEffect(() => {
    if (asset[0]) console.log(asset[0].totalAsset);
  }, [asset])


  return (
    <>
          <tr>
            <td style={{"paddingRight" : "20px"}}>
              <div className="my_totlabudget_title"> 내 자산총액</div>
              <div className="my_totlabudget_money">{asset[0] && asset[0].totalAsset}원</div>
            </td>
            <td style={{"paddingRight" : "20px"}}>
              <div className="my_totlabudget_title">평가 수익률</div>
              <div className="my_totlabudget_money" style={{ "color" : "#"}}>{asset[0] && asset[0].totalProfitRatio} %</div>
            </td>
            <td style={{"paddingRight" : "20px"}}>
              <div className="my_totlabudget_title">평가 손익</div>
              <div className="my_totlabudget_money">{asset[0] && asset[0].totalProfit} 원</div>
            </td>
          </tr>
    </>
  );
};

export default TotalBudget;
